            // เพิ่มไปจนถึงโซนที่ 30
        ];

        // เปลี่ยนพิกัดโซนเป็นพหุเหลี่ยม
        const polygons = zones.map(zone => ({
            name: zone.name,
            polygon: createZone(zone.coordinates)
        }));

        // เมื่อกด submit ฟอร์ม
        document.getElementById('locationForm').addEventListener('submit', function(event) {
            event.preventDefault();

            // รับค่าจาก input
            const latitude = parseFloat(document.getElementById('latitude').value);
            const longitude = parseFloat(document.getElementById('longitude').value);

            // สร้างจุดจากพิกัด Lat, Long
            const point = turf.point([longitude, latitude]);

            // สร้าง array เพื่อเก็บผลลัพธ์
            let results = [];

            polygons.forEach(zone => {
                const isInside = turf.booleanPointInPolygon(point, zone.polygon);
                const distance = turf.pointToLineDistance(point, turf.lineString(zone.polygon.geometry.coordinates[0]), {units: 'kilometers'});

                // เก็บผลลัพธ์ใน array พร้อมข้อมูลระยะทางและสถานะว่าตำแหน่งอยู่ในโซนหรือไม่
                results.push({
                    name: zone.name,
                    isInside: isInside,
                    distance: distance
                });
            });

            // จัดเรียงผลลัพธ์ตามระยะทางจากจุดที่ค้นหา
            results.sort((a, b) => a.distance - b.distance);

            // แสดงผลเฉพาะ 5 โซนแรก
            const resultsElement = document.getElementById('results');
            resultsElement.innerHTML = ""; // ล้างข้อมูลเก่า

            results.slice(0, 5).forEach(result => {
                const resultText = `ตำแหน่งใน ${result.name}: ${result.isInside ? 'อยู่ใน' : 'อยู่นอก'}โซน, ระยะทาง: ${result.distance.toFixed(3)} กิโลเมตร`;
                const resultElement = document.createElement('p');
                resultElement.textContent = resultText;
                resultsElement.appendChild(resultElement);
            });
        });
        function getLocation() {
            if (navigator.geolocation) {
                navigator.geolocation.getCurrentPosition(showPosition, showError);
            } else {
                alert("Geolocation is not supported by this browser.");
            }
        }

        function showPosition(position) {
            const lat = position.coords.latitude;
            const long = position.coords.longitude;
            document.getElementById("latitude").value = lat;
            document.getElementById("longitude").value = long;
        }

        function showError(error) {
            switch (error.code) {
                case error.PERMISSION_DENIED:
                    alert("User denied the request for Geolocation.");
                    break;
                case error.POSITION_UNAVAILABLE:
                    alert("Location information is unavailable.");
                    break;
                case error.TIMEOUT:
                    alert("The request to get user location timed out.");
                    break;
                case error.UNKNOWN_ERROR:
                    alert("An unknown error occurred.");
                    break;
            }
        }
    </script>
